// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DNSRegistry {
    struct Domain {
        string ip;
        address owner;
    }

    mapping(string => Domain) private domains;

    event DomainRegistered(string domain, string ip, address owner);
    event DomainUpdated(string domain, string ip);

    function registerDomain(string memory domain, string memory ip) public {
        require(domains[domain].owner == address(0), "Domain already registered");
        domains[domain] = Domain(ip, msg.sender);
        emit DomainRegistered(domain, ip, msg.sender);
    }

    function updateDomain(string memory domain, string memory ip) public {
        require(domains[domain].owner == msg.sender, "Only the owner can update the domain");
        domains[domain].ip = ip;
        emit DomainUpdated(domain, ip);
    }

    function getIP(string memory domain) public view returns (string memory) {
        return domains[domain].ip;
    }
}
